@armacourses is finally launching a podcast!!! And we’re launching IN 3 DAYS Y’ALL

Me and @will.wilsonjr have created something really special and Season One is going to be 🔥

I cannot wait to release this BIBLE podcast and add our voices to the incredible mix of other amazing Bible podcasts on the internet.

If you work well then you will rest well. If we were to focus up and dedicate ourselves to our work then we could come home and rest well. 
 @will.wilsonjr and I LOVED this conversation. We know we ruffled some feathers with our laziness episode so hopefully this balances the conversation. 

